import React from "react";
import { useState, useEffect } from "react";
// import { Link } from "react-router-dom";
import styled from "styled-components";
// import { Storys } from "../data";
import "../app.css";

const Container = styled.div`
  display: flex;
`;
const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  flex-wrap: wrap;
  overflow: hidden;
  margin: 30px;
`;
const Card = styled.div`
  display: flex;
  justify-content: center;
  flex-direction: column;
  flex: 1;
  margin: 20px;
  padding: 20px;
  border-radius: 10px;
  background-color: ${(props) => props.bg};
  -webkit-box-shadow: 0px 0px 15px -10px rgba(0, 0, 0, 0.75);
  box-shadow: 0px 0px 15px -10px rgba(20, 0, 0.75);
`;

const Cardcon = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 5px;
`;

const Img = styled.img`
  height: 250px;
  width: 250px;
  object-fit: cover;
  border-radius: 10px;
`;

const UserShow = styled.div`
  flex: 1;
  padding: 20px;
`;

const UserShowBottom = styled.div`
  margin-top: 20px;
`;
const UserShowTitle = styled.span`
  font-style: 14px;
  font-weight: 600;
  color: rgb(175, 170, 170);
`;
const UserShowInfo = styled.div`
  display: flex;
  align-items: center;
  margin: 20px 0px;
  color: #444;
`;

const UserShowUsername = styled.span`
  font-weight: 600;
  margin-left: 10px;
`;

const UserShowInfoTitle = styled.span`
  margin-left: 10px;
`;

const Cards = () => {
  const [cards, setCards] = useState([]);

  const getCards = async () => {
    // const res = await fetch("https://api.pokemontcg.io/v2/cards");
    // setCards(await res.json());
  };

  useEffect(() => {
    getCards();
  }, []);

  return (
    <div>
      <Container>
        <Wrapper>
          {/* {cards.map((item) => ( */}
          <Card>
            <Cardcon>
              <Img src="./f1.jpg" />
            </Cardcon>

            <UserShow>
              <UserShowBottom>
                <UserShowTitle>Account Details</UserShowTitle>
                <UserShowInfo>
                  <UserShowUsername>Username : </UserShowUsername>
                  <UserShowInfoTitle>punam1995</UserShowInfoTitle>
                </UserShowInfo>
                <UserShowInfo>
                  <UserShowUsername>Created At : </UserShowUsername>
                  <UserShowInfoTitle>10.12.2000</UserShowInfoTitle>
                </UserShowInfo>
              </UserShowBottom>
            </UserShow>
          </Card>
          {/* ))} */}
        </Wrapper>
      </Container>
    </div>
  );
};

export default Cards;
